/* eslint-disable import/no-anonymous-default-export */
import './'
import Card001 from "../Header/Carroussel/Card04/Card001";
import Card002 from "../Header/Carroussel/Card04/Card002";
import Card003 from "../Header/Carroussel/Card04/Card003";
import Card004 from "../Header/Carroussel/Card04/Card004";
import Card005 from "../Header/Carroussel/Card04/Card005";
import Card006 from "../Header/Carroussel/Card04/Card006";


import img09 from "../../../src/Foto/img/cancun.jpg";
import img10 from "../../../src/Foto/img/toquio.jpg";
import img11 from "../../../src/Foto/img/Dubai1.jpg";
import img12 from "../../../src/Foto/img/caribeHolandes.jpg";
import img13 from "../../../src/Foto/img/Madri.jpg";
import img14 from "../../../src/Foto/img/Bariloche .jpg";



export default () => {
    return(

<>
        <h3>Pacote de Viagem Internaconal</h3>

   <Card001 Foto={img14 }  ></Card001>
   <Card002 Foto={img09 }  ></Card002>
   <Card003 Foto={img10 }  ></Card003>
   <Card004 Foto={img11 }  ></Card004>
   <Card005 Foto={img12 }  ></Card005>
   <Card006 Foto={img13 }  ></Card006>
 

   </>
    );
}
